import React from 'react';
import Question from "./Question"
import Grid from "@material-ui/core/Grid";


function Questions({props, upPost}) {
    const questions = props.questions;

    const questionTest = questions.map(((q, index) => {
        return (
            <Question
                key={index}
                questions={q}
                index={index}
                upPost={upPost}
            />
        )
    }));

    return (
            <Grid
                container
                direction="row"
                justify="center"
                alignItems="center"
            >
                {questionTest}
            </Grid>

    )
}

export default Questions;
